import React from 'react';
import './data.css';
import { useHistory } from 'react-router-dom';
import {Box, TextField, Button, CloseI} from '@mui/material';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';

export default function Data() {
  let history = useHistory();
    const submit = () => {
        history.push("/data");
        const [open, setOpen] = React.useState(false);

        const handleClick = () => {
          setOpen(true);
        };
      
        const handleClose = (event: React.SyntheticEvent | Event, reason?: string) => {
          if (reason === 'clickaway') {
            return;
          }
      
          setOpen(false);
        };
    }

  return (
    <>
    <div className="data">
      <div className = "mdata"> 
          <h1>My Fitness Tracker</h1>
          <div> 
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
          <TextField required id="outlined-basic" label="Exercise Name" variant="outlined" />
          <TextField required id="outlined-basic" label="Sets" variant="outlined" />
          </Box>
          </div>

          <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
            <TextField required id="outlined-basic" label="Reps" variant="outlined" />
            <TextField required id="outlined-basic" label="Unit" variant="outlined" />
            </Box>
            </div>

            <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
        
      }}
      noValidate
      autoComplete="off"
    >
              <TextField required id="outlined-basic"  label="Date" variant="outlined" />
              </Box>
              </div>
              <div>
                
                <Button variant="contained" onClick = {submit}>Submit</Button>
                <Snackbar
                    open={open}
                    autoHideDuration={6000}
                    onClose={handleClose}
                    message="Note archived"
                    action={action}
                  /></div>
              
      </div>
          
        </div>
        
    </>
  )
}
